import React, { Component } from 'react';
 import { Image } from 'react-bootstrap';
 import '../'
 

class homepage extends Component {
  render() {
    return (
      <div className='bg'>
      <Image src="holder.js/100px250" fluid />
        <h3>WELCOME TO ONLINE WORLD</h3>
      </div>
    );
  }
}

export default homepage;
